script: |
  super -f text -I q1258.spq | sort > q1258.out

inputs:
  - name: q1258.spq
    data: |
      SELECT DISTINCT + col1 * + 48 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 * col1 * - col0 + - ( + col1 ) BETWEEN - col2 AND + col0;
  - name: tab2

outputs:
  - name: q1258.out
    data: |
      2448
      3216
      3696
